return $input.all().map(item => {
  let maxCount = 0;
  for(const tag of item.json.tags) {
    if (tag.count > maxCount) {
      maxCount = tag.count;
    }
  }
  return {
  ...item,
  json: {
    ...item.json,
    tags: item.json.tags.map(tag => ({
      ...tag,
      count: tag.count/maxCount * 100,
      name: tag.name.toLowerCase()
    }))
  }
}});

